import React from 'react';

export default function Home() {

    state = {
        make: '',
        model: ''
    }

    makeHandler = (event) => {
        this.setState({
            make: event.target.value
        });
    }

    modelHandler = (event) => {
        this.setState({
            model: event.target.value
        });
    }

    return (
        <div className="Home">
            <h1>Home</h1>
            <p>Make: {this.state.make}</p>
            <p>Model: {this.state.model}</p>
            <p>Enter your make, and model:</p>
            <form onSubmit={this.SubmitHandler}>
            <input
                type='text'
                placeholder='Make'
                onChange={this.makeHandler}
            />
            <input
                type='text'
                placeholder='Model'
                onChange={this.modelHandler}
            />
            <input
                type='submit'
            />
            </form>
        </div>
    );
};
